import React, { useState } from 'react';
import axios from 'axios';

const DataInputForm = () => {
    const [formData, setFormData] = useState({
        energy: '',
        transportation: '',
        waste: ''
    });
    const [loading, setLoading] = useState(false);
    const [message, setMessage] = useState({ type: '', text: '' });

    const handleChange = (e) => {
        setFormData({
            ...formData,
            [e.target.name]: e.target.value
        });
    };

    const handleSubmit = async (e) => {
        e.preventDefault();
        setLoading(true);
        setMessage({ type: '', text: '' });

        try {
            const token = localStorage.getItem('token');
            await axios.post(
                'http://localhost:5000/api/data/add',
                formData,
                { headers: { Authorization: `Bearer ${token}` } }
            );
            setMessage({ type: 'success', text: 'Data added successfully!' });
            setFormData({ energy: '', transportation: '', waste: '' });
        } catch (err) {
            setMessage({ type: 'error', text: err.response?.data?.message || 'Error adding data' });
        } finally {
            setLoading(false);
        }
    };

    return (
        <div className="page-container">
            <div className="page-header">
                <h1>Input Emission Data</h1>
                <p className="page-subtitle">Record your organization's carbon emissions</p>
            </div>

            <div className="form-card">
                {message.text && (
                    <div className={`alert alert-${message.type}`}>
                        {message.text}
                    </div>
                )}

                <form onSubmit={handleSubmit} className="input-form">
                    <div className="form-group">
                        <label htmlFor="energy">
                            <i className="fas fa-bolt"></i> Energy Consumption (kg CO2)
                        </label>
                        <input
                            type="number"
                            id="energy"
                            name="energy"
                            value={formData.energy}
                            onChange={handleChange}
                            placeholder="Enter energy consumption"
                            required
                            min="0"
                            step="0.01"
                            className="form-control"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="transportation">
                            <i className="fas fa-car"></i> Transportation (kg CO2)
                        </label>
                        <input
                            type="number"
                            id="transportation"
                            name="transportation"
                            value={formData.transportation}
                            onChange={handleChange}
                            placeholder="Enter transportation emissions"
                            required
                            min="0"
                            step="0.01"
                            className="form-control"
                        />
                    </div>

                    <div className="form-group">
                        <label htmlFor="waste">
                            <i className="fas fa-trash"></i> Waste (kg CO2)
                        </label>
                        <input
                            type="number"
                            id="waste"
                            name="waste"
                            value={formData.waste}
                            onChange={handleChange}
                            placeholder="Enter waste emissions"
                            required
                            min="0"
                            step="0.01"
                            className="form-control"
                        />
                    </div>

                    <button 
                        type="submit" 
                        className="btn btn-primary btn-large"
                        disabled={loading}
                    >
                        {loading ? (
                            <>
                                <div className="loading-spinner-small"></div>
                                Submitting...
                            </>
                        ) : (
                            <>
                                <i className="fas fa-save"></i>
                                Save Data
                            </>
                        )}
                    </button>
                </form>
            </div>
        </div>
    );
};

export default DataInputForm;
